import React from 'react';
import {Link} from "react-router-dom"

const Home = () => {
    return (
        <div>
            <Link to='/'>Home</Link>
            <Link to='/about'>AboutUs</Link>
            <Link to='/cart'>cart</Link>
        </div>
    );
};

export default Home;
